/**
 * 请求方法
 */

import base from './base';
import axios from "axios";
const api={
    /**
     * ksleak分页查询数据
     * @param params当前页码
     * @returns {Promise<axios.AxiosResponse<any>>}
     */
    getleakList(params){
        return axios.get(base.leakList,{params})
    },
    postleakinsert(data){
        return axios.get(base.leakinsert, {data})
    }
}
export default api;
